import React from 'react';
import { Text, View, FlatList } from "react-native";
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome'
import { faHourglassStart, faCheckCircle, faWrench, faTrashAlt } from '@fortawesome/free-solid-svg-icons';
function dataTable(props) {
    return (
        <FlatList data={props.dataTable}
            keyExtractor={item => item.id.toString()}
            renderItem={
                ({ item }) => 
                <View style={props.styeContItemList}>
                    <View style={props.styleInfoTable}>
                        <Text style={props.styleItemList}>
                            {item.id}
                        </Text>
                        <Text style={props.styleItemList}>
                            {item.primerNombre + ' '+ item.primerApellido + ' '+ item.cedula}
                        </Text>
                    </View>
                    <View style={props.styleIconTables}>
                        {(item.status === "done") ? (
                            <View style={props.styleIconStatusDone}>
                                <FontAwesomeIcon icon={faCheckCircle} style={{ color: '#81f499' }}/>
                            </View>
                        ) : (
                                <View style={props.styleIconStatusProcessing}>
                                    <FontAwesomeIcon icon={faHourglassStart} style={{ color: "#E63946" }} />
                                </View>
                            )}
                        <View style={props.styleIconUpdate}>
                            <FontAwesomeIcon icon={faWrench} style={{ color:"#98C1D9" }} />
                        </View>
                        <View style={props.styleIconTrash}>
                            <FontAwesomeIcon icon={faTrashAlt} style={{ color:"#E63946" }} />
                        </View>
                    </View>
                </View>
            }
        />
    );
}

export default dataTable;
